(18, 'amie-de-fille', 'amie de fille', 'ami de fille', '', '', 'Le \"e\" muet ne s\'entend pas. On ajoute donc \"de fille\" pour préciser que ce n\'est pas \"un ami\", qu\'on peut confondre avec \"fiancé\".', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(19, 'anglais', 'Anglais', '', '', 'L\'éloignement des Anglais d\'Angleterre pour les Québécois, couplé au fait de la proximité des Canadiens Anglais et des États-Uniens expliquent cette utilisation générale du terme…', 'Une expression équivalente est utilisée en Suisse romande : « Allemand » utilisé seul désigne une personne Suisse alémanique alors qu\'« Allemand d\'Allemagne » désigne une personne allemande', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(20, 'anglais-dangleterre', 'Anglais d\'angleterre', '', '', 'Au Québec, les termes « Canadien anglais » ou « Canada anglais » sont souvent utilisés pour faire référence à tous les Canadiens anglophones, qu\'ils soient d\'origine britannique ou non', 'Une expression équivalente est utilisée en Suisse romande : « Allemand » utilisé seul désigne une personne Suisse alémanique alors qu’« Allemand d\'Allemagne » désigne une personne allemande', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(21, 'anglo', 'anglo', '', '', '', 'Ce terme n\'est pas péjoratif. Les termes anglophones et francophones sont beaucoup utilisés, d\'où l\'abréviation. Remarque : \"anglophone\" se dit en anglais au Canada. C\'est un exemple d\'influence du français dans la langue anglaise du Canada (dans les autres pays anglophones, anglophone se dit \"english speaking\").', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
