(96, 'bibitte-bebitte', 'bibitte, bébitte', 'Bibitte, bébitte, bebitte', '', 'Le mot apparaît d\'abord en flamand sous le forme de wimpel (foret, tarière) qui donne ensuite l\'anglais wimble (vrille, vilebrequin) et l\'ancien français guibelet qui devînt guimbelet puis guibet pour désigner les moustiques puisque la femelle pique comme si elle avait une vrille. Au XVe siècle, guibet devient bibet en Normandie pour désigner le cousin, le pou et le moucheron ainsi que bibiss en wallon pour le pou. En Nouvelle-France, le terme bibet évolue naturellement vers bibite ou bébitte pour désigner les insectes.', '', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
