(291, 'une-couple', 'couple (une)', 'Couple, coupe, coupeul', 'Coupeul, coupe', 'De l\'anglais \"a couple of...\", qui signifie \"deux\".', 'Bien qu\'en anglais \"a couple\" signifie généralement deux, en québécois, \"une couple\" est un nombre indéterminé.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
