(302, 'creme-glacee', 'crème glacée', '', '', 'Les premières glaces qui ont été introduites en France au XVIe siècle n\'étaient pas à base de crème ou de lait; elles étaient à base de fruits, de fleurs ou de jus de fruits refroidis par la glace. On utilisait alors le terme « glace»  pour nommer ce type de boissons glacées ou de sorbets liquides (et plus tard, les autres catégories de glaces) et aussi certaines autres expressions comme « boire à la glace » , « frappé de glace » (pour une boisson refroidie dans la glace), « cerises à la glace », « framboises à la glace », etc. C\'est ce qui explique que le terme « glace » s\'est généralisé en français d\'Europe pour nommer toutes les catégories de glaces alimentaires (glace à l\'eau, glace au lait, glace au tofu, glace au yaourt, etc.) et particulièrement la très populaire crème glacée.', 'Au Canada français, c\'est « crème glacée », la traduction de « iced cream » (terme qui a précédé « ice cream »), qui s\'est imposé, étant donné la popularisation du produit par l\'industrie américaine. « Crème glacée » a d\'ailleurs remplacé les termes « crème à la glace » et « crème à glace » dont la vitalité est maintenant faible en français du Québec. ', 'Aujourd\'hui, « glace » et « crème glacée » sont utilisés comme synonymes au Québec et en Europe, même si on observe toujours la même généralisation de « glace » en français européen et de « crème glacée » en français du Québec.', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(303, 'creme-glacee-molle', 'crème glacée molle', '', 'De la molle, un cornet de molle', '', '', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
