(481, 'francais-de-france', 'français de france', '', '', '', 'Les québécois savent qu\'ils ont un accent en France mais, au Québec, ce sont les Français (de France) qui en ont un. Autrement dit, les Français de France disent qu\'ils parlent le VRAI français et que le reste de la francophonie n\'est que de vulgaires et imcompréhensibles dialectes.', 'Ce terme n\'est pas péjoratif, parce que nous sommes trop gentils.', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(482, 'frapper-un-noeud', 'frapper un noeud', '', '', 'Il est possible que l\'expression vienne des bûcherons. Quand on tombe sur un noeud dans un tronc d\'arbre ou une bûche, ce n\'est pas facile de hacher.', '', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
