(485, 'fridge', 'fridge', 'frid\'je', '', 'Provient de la marque Frigidaire. Abbréviation de frigo, mais prononcée à l\'anglaise.', '', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
