(496, 'game', 'game', 'À l\'anglaise, \"gaïme\"', '', 'Anglais.', 'Notons qu\'on dit \"a football match\" en Angleterre, \"un match de foot\" en France, \"A soccer game\" aux Etats-Unis et au Canada anglophone, et \"une game de soccer\" au Québec. Cela signifie que l\'appartenance géographique prend dans ce cas le dessus sur l\'appartenance linguistique.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
