(498, 'gang', 'gang', 'gagne', '', 'De l\'anglais \"gang\", groupe.', 'Rien à voir avec les gangsters. En effet, en France, on dit \"un gang\" (prononcé à la française) pour une bande de malfaiteurs. Se prononce plus ou moins à l\'anglaise : gagne ou gingue.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(499, 'garde-robe', 'garde-robe', '', '', '', 'Dans la plupart des pays francophone, \"garde-robe\" a aussi ce sens mais en France ce mot est plutôt utilisé dans le sens de \"ensemble des vêtements appartenant à une personne\" (et est dans ce cas féminin).', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(500, 'gardienne', 'gardienne', '', '', '', 'En France, la gardienne est la concierge, la gardienne d\'immeuble. En Belgique, gardienne a le même sens qu\'au Québec. Les Belges disent d\'ailleurs souvent école gardienne pour dire école maternelle.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
