(541, 'huart', 'huart', '', '', '', 'C\'est l\'oiseau qui est sur les pièces de 1 dollar canadien. Par extension, un \"huard\" est donc également une pièce de 1 dollar.\r\n\r\nEn anglais on dit un \"loonie\" car l\'oiseau en question est appelé \"loon\" dans cette langue.\r\n\r\nLe chant du huard est splendide, et crée une atmosphère nocturne mystérieuse sur les lacs québécois.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
