(547, 'inuit', 'inuit', 'inouïte', '', '', 'Inuk (au pluriel : inuit), signifie \"être humain\" dans la langue des Inuits. En Français (de France ou du Québec) on dit un inuit, des inuits, sauf chez les puristes. Le terme \"esquimau\" qui signifie \"qui mange de la viande crue\", est péjoratif pour les Inuits. L\'Inuktitut est la langue des Inuits.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(548, 'itinerant', 'itinérant', '', '', '', 'Le journal \"L\'itinéraire\", publié par des itinérants de Montréal, est donc un jeu de mots avec le terme.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(549, 'itou', 'itou', 'Le \"i\" peut disparaît (selon la région) lorsque itou suit \"moi/moé\" ou \"toi/toé\"', '', 'Provient du vieux français (à tout).  ', 'Se dit également dans certaines régions françaises, mais rarement. Beaucoup pensent à tort qu\'il s\'agit d\'un anglicisme, car le mot too se retrouve aussi en anglais avec la même définition. ', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
