(613, 'malard', 'malard', '', '', 'Vient du normand.', 'Le colvert fait partie des quelques espèces d\'oiseaux communes aux continents américain et européen.\r\n\r\nEn anglais, un colvert est un \"mallard Duck\".', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(614, 'malin', 'malin', '', '', 'Au temps de la colonisation, \"malin\" qui vient de \"mal\" signifiait \"méchant\", \"mauvais\" en français (comme c\'est toujours le cas dans le domaine médical). Ce mot a ensuite évolué différemment en France, mais a gardé la même signification au Québec, chez les plus vieux.', '', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(615, 'malle', 'malle', '', 'Boîte à malle', 'Vient de l\'ancien français (la malle-poste). Le mot anglais \"mail\" est d\'ailleurs issu de \"malle\".', '', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
