(680, 'chier-sur-le-bacul', 'Chier sur le bacul', '', '', 'Le bacul étant une pièce du harnachement derrière le cheval à laquelle est attaché la corde de traction. Quand le cheval tire: le bacul s\'éloigne de son postérieur et il est impossible qu\'il y défèque. Mais si le cheval est arrêté le bacul est relâché et se retrouve juste au bon endroit pour que le cheval défèque dessus.', '', '', 1, '2015-10-21 20:47:16', '2019-04-05 14:59:29'),
(681, 'outaouais', 'Outaouais', '', '', '', '', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(682, 'outarde', 'outarde', '', '', 'La confusion vient probablement du fait que ces deux espèces d\'oiseaux ont une taille et des couleurs semblables.', 'Dans le sud de la France, l\'\"outarde canepetière\" est un oiseau de l\'ordre des gruiformes, à mi-chemin entre une poule et une grue.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
