(707, 'patates-pilees', 'patates pilées', '', '', 'Les patates, écrasées au pilon, sont pilées.', 'En Amérique du Nord, la purée de pommes de terre passées à la moulinette n\'est pas chose courante. On écrase plutôt les patates avec un instrument électrique adapté, ou un pilon.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(708, 'pate-a-dent', 'pâte à dent', '', '', 'Traduction de l\'anglais \"Toothpaste\".', '', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(709, 'pate-chinois', 'pâté chinois', '', '', 'Ne vient pas de Chine ! Le mot proviendrait plutôt du met que l\'on servait aux immigrants chinois qui construisaient le chemin de fer pan-canadien.', 'Il s\'agit en quelques sortes du hâchis parmentier mangé en France, mais amélioré. Les anglophones le nomment shepperd\'s pie.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
