(732, 'piasse', 'piasse', '', '', 'Avant l\'introduction du dollar canadien, la \"piastre\" espagnole circulait au Canada.', 'À ne pas confondre avec le mot \"pièce\". On NE peut traduire par : \"Ça m\'a coûté 30 pièces\"', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
