(735, 'pichet', 'pichet', '', '', '', 'Au Québec, il existe des pichets de 40 onces ou de 60 onces. Le pichet le plus répandu est le pichet de 60 onces (soit 3 pintes impériales). Cela est probablement dû à l\'héritage britannique du Canada.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(736, 'pichou', 'pichou', '', 'pichou au féminin aussi', '', 'Le \"Pichou\" existe également dans le sud de la France. Il s\'agit d\'un gamin mal élevé, qui vole, ment mais est tellement gentil... qu\'on lui donnerait le bon dieu sans confession. Lorsque le gamin devient adulte, on parle de \"Piche\". Ce qui donne l\'expression \"Y a les piches et les pichous\" (avec l\'accent du sud).', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
