(749, 'pissou', 'pissou', '', '', 'Pissou, attesté comme terme d\'injure, est connu en québécois depuis la fin du XVIIIe siècle, mais il remonte probablement au début du régime français. En français standard populaire du nord-ouest de la France, pissou signifiait \"enfant qui pisse au lit\". Pissou dériverait du verbe pisser, du latin populaire pissiare \"uriner\".  \nOn a longtemps cru que pissou \"lâche, peureux\" venait de l\'anglais \"pea soup\". L\'appellation anglaise \"pea soup\" est d\'abord signalée, chez les anglophones, pour parler des \"Canadiens français\", reconnus pour manger de la soupe aux pois. La rencontre des deux mots, pissou \"lâche\" et \"pea soup\" sur le plan formel et phonétique, a certainement joué dans l\'évolution du terme, puisque sa valeur dépréciative est signalée vers 1896. Pissou, sobriquet populaire, a aussi existé en France, mais aujourd\'hui il est sorti de l\'usage courant.', '', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
