(754, 'pitou', 'pitou', '', '', '', 'Un \"toutou\", au Québec, est un nounours, une peluche.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(755, 'pitoune', 'pitoune', '', '', 'Les draveurs, qui étaient chargés de faire en sorte que les billots de bois descendent bien le cours de la rivière jusqu\'à la scierie, allaient le samedi soir à la ville voir les filles. En anglais, ça se disaient \"to go to happy town,\" et ça s\'est transformé dans la bouche des francophones en \"aller à la pitoune\". Dès lors, une prostituée étaient une \"pitoune\", mot ensuite donné aux billots. ', '', 'Les hommes utilisent ce mot entre eux pour blaguer, mais pas devant une femme. ', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(756, 'place', 'place', '', '', 'Traduction de l\'anglais.', 'L\'utilisation française existe aussi. Exemple :\n\"- Yé où le scott towell ? \n- Yé à sa place, dans l\'armoire !\"', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
