(772, 'portage', 'portage', '', 'Faire du portage, portager', '', 'Le canot-camping est une activité de week-end ou de vacances très courante que l\'on peut pratiquer sur de nombreux lacs québécois. Comme son nom l\'indique, on y fait du canoë et on campe, d\'une île à l\'autre, ou d\'un lac à l\'autre.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
