(774, 'portique', 'portique', '', '', '', 'Il en existe dans pratiquement toutes les habitations : c\'est une pièce très utile pour les hivers québécois, où l\'on se débarrasse de son manteau mouillé et de ses bottes boueuses, et qui rempli parfois la fonction de sas (pour le froid).', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
