(777, 'poudreuse', 'poudreuse', '', '', '', 'En France, à basse altitude, on parle de poudreuse pour tout type de neige, pourvu qu\'elle ne fonde pas tout de suite. \r\nMais dans les régions à hivers froids (où il existe un vocabulaire précis et complet pour parler de neige) ce terme est utilisé de la même manière.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
