(791, 'quebec', 'Québec', 'Ké-bek', '', 'Signifie \"Là où le fleuve se rétrécit\".', 'On distingue le nom de la Province de celui de sa capitale par l\'article : \"Je vis au Québec\" ou \"Je vis à Québec\". Si bien que de dire \"Ville de Québec\" ou \"Québec ville\" est inutile. En anglais l\'article (in) ne permet pas cette distinction et les anglophones disent \"in Quebec City\" pour parler de la ville et \"in Quebec\" pour parler de la province. \"Québec\" vient d\'un mot Amérindien qui signifie \"là où le fleuve se rétrécit\".', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
