(813, 'a-la-revoyure', 'revoyure (à la)', '', '', '', 'Peu utilisé. Quand un Français de France, pour imiter un québécois, dit \"à la revoyure\", il est un peu à côté de la plaque. ', 'Cette expression est utilisée en France.', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
