(816, 'robineux', 'robineux', '', '', 'Provient du terme \'\'rubbing alcohol\'\' qui signifie\nalcool à friction; alcool à usage médical que l\'on vend en pharmacie (au drugstore).\nAlcool très dangereux\nque certains sans-abri convoitent pour son prix modique. d\'où robineux: buveur de robine.', 'N\'essayez pas ça à la maison.\nPeut rendre aveugle ou presque.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(817, 'roche', 'roche', '', '', '', 'En France, une roche est plutôt de la taille d\'un rocher, c\'est à dire beaucoup plus gros qu\'une roche québécoise.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
