(821, 'rossignol', 'rossignol', '', '', 'Les premiers colons français ont entendu un petit oiseau nord-américain avec un beau chant. Ils l\'ont donc appelé \"Rossignol\", comme le rossignol européen qui chante bien.', 'Même quiproquos qu\'avec le Rouge-gorge.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(822, 'roteux', 'rôteux', '', '', '', 'Une \"roteuse\" en France, c\'est de la bière. Un roteux et une roteuse, un beau couple.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(823, 'rotie', 'rôtie', '', '', '', 'Le mot anglais \"toast\" vient du français \"tossier\", qui est un instrument dont on se sert pour faire griller le pain au-dessus du feu.\nLe mot toast est également utilisé au Québec.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(824, 'roue', 'roue', '', '', 'Traduction de l\'anglais \"(steering) wheel\".', '', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
(825, 'rouge-gorge', 'rouge-gorge', '', '', 'Les premiers colons français ont donné aux oiseaux américains des noms d\'oiseaux européens en se basant sur des critères pas très scientifiques, comme la couleur par exemple.', 'En Europe le rouge-gorge est un petit oiseau de la taille d\'un moineau.', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
