(865, 'sentir-le-swing', 'sentir le swing', '', '', 'Cette expression, du début des années \'60, fait référence à une marque de commerce de bas de gamme de breuvage instantané en cristaux à diluer dans un pichet d\'eau. Le mélange de saveurs orange-limette, mal équilibré, avait une odeur d\'urine fétide.', 'Au Québec, plusieurs produits sont encore couramment appelés par le nom du premier fabricant de cet objet : du coke, du 7up, un ski-doo, des stanfield, du cheese whiz, des corn flakes, de la p\'tite vache, etc.', 'Sentir le swing est une façon de dire qu\'il est plus que temps d\'aller prendre une douche ; l\'odeur est insupportable...', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
