(950, 'tip', 'tip', '', '', 'De l\'anglais.', 'Le pourboire n\'est pas inclus dans le prix des services au Canada, et il est donc d\'usage de laisser de 10 à 15% du prix en pourboire. Pour une bière dans un bar c\'est 1$. Pour un pichet c\'est 1,5$ ou 2$. Si vous ne donnez rien, vous passez immédiatement pour un \"maudit Français\".', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
