(962, 'tourtiere', 'tourtière', '', '', 'Ce plat est originaire du Saguenay-Lac-Saint-Jean.', 'La tourtière ne doit pas son nom à la tourte qui fut chassée jusqu\'à son extinction au début du 20e s. Le mets a le nom du contenant de cuisson au four nommé « tourtière » connu depuis le 16e s. et dérivé de « tourte » synonyme de « tarte ». La tourtière comprend traditionnellement de la viande de gibier ou de venaison et, le plus souvent, de nos jours, du  boeuf (ou veau) et du porc en cubes avec des cubes de pommes de terre, le tout dans une abaisse qui enveloppe entièrement la préparation.\n\nCertaines personnes pensent que un \"six pâtes\", un \"cipaille\" ou un \"paté à la viande\" sont des équivalents, mais il n\'en est rien. ', '', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29'),
