(984, 'precede-de-tu', 'tu (précédé de ', '', '', 'Du vieux français \"ti\": Il neigera-ti à Noël ? Déformation de \"t\'il\" : Neigera-t\'il à Noël ? Ne se place qu\'après les questions auxquelles on peut répondre par \"oui\" ou \"non\". (On ne dit pas : \"Tu t\'appeles-tu comment?\")', '', 'S\'utilise à toutes les personnes (j\'ai-tu, t\'as-tu, etc.), mais son emploi avec nous et vous choque l\'oreille (on dira \"on a-tu\" ou \"avons=nous\" plutôt que \"nous avons-tu\" et \"avez-vous\" plutôt que \"vous avez-tu\")', 1, '2008-09-24 02:10:22', '2019-04-05 14:59:29');
