(1163, 'baswell', 'Baswell', 'bâsouelle, bohzouelle  bawszouelle', 'Boswell', 'Ce mot tient son origine de la brasserie Boswell, fondée par John Boswell en 1852. Cette brasserie fut construite sur le site des palais des intendants dans la ville de Québec. Cette exclamation a été oubliée pendant des décennies pour revenir auprès de certains jeunes à compter des années 1980. Elle a entre autres été utilisée par Jacques Chevalier Longueuil, du groupe Les Bleus Poudres.', 'Popularisé auprès des jeunes par le personnage de Monsieur Pitre dans la série jeunesse « Une grenade avec ça? », le mot « baswell » était son exclamation préférée. ', 'Comment au Nouveau-Brunswick\n', 1, '2011-03-31 05:34:45', '2019-04-05 14:59:29'),
