(1173, 'balancer', 'Balancer', '', '', 'Anglicisme qui vient du verbe « to balance », qui signifie « équilibrer ».', '', 'En chimie, on parle souvent de « balancer » une équation chimique, c\'est-à-dire équilibrer les proportions de chaque molécule pour que les réactifs soient totalement transformés en produits. Cet usage est à critiquer puisque « balancer » a perdu ce sens, en français.', 1, '2011-05-13 20:38:03', '2019-04-05 14:59:29'),
