(1175, 'rapailler', 'rapailler', 'ra-pa-yé', '', 'À l\'origine, cela voulait dire « remettre de la paille » (dans un épouvantail). Le sens figuré vient du fait qu\'il faut rassembler les fétus de paille épars pour pouvoir ensuite les mettre dans l\'épouvantail.', '', 'On dirait que c\'est un terme littéraire, car il ne s\'entend pas dans le langage courant.', 1, '2011-05-16 16:37:12', '2019-04-05 14:59:29'),
