(1178, 'criard', 'criard', '', '', 'Le terme « criard » vient de « criard à brume », qui désignait une sirène d’alerte émettant, par temps de brouillard, un signal sonore avertisseur, afin de permettre aux embarcations en mer de repérer la côte.', '', '« Klaxon » était, à l\'origine, une marque de commerce qui désignait un avertisseur de la marque de ce nom équipant certaines automobiles. Ce terme est bien ancré dans l\'usage en tant que nom commun et il désigne aujourd\'hui un avertisseur sonore, peu importe la marque. « Criard » est d\'usage familier au Québec.', 1, '2011-05-23 04:07:27', '2019-04-05 14:59:29'),
