(1255, 'prioriser', 'Prioriser', '', '', 'L’emploi du verbe prioriser et du nom priorisation a longtemps été déconseillé, parce que ces mots n’étaient attestés dans aucun dictionnaire de langue et qu’ils étaient critiqués dans la plupart des ouvrages correctifs. On conseillait donc de remplacer ces deux mots, qui viennent de l’anglais to prioritize et prioritization, par divers équivalents, selon le contexte.', '(Néologisme). Ce mot est considéré par certains comme un barbarisme de la langue française. Pour d’autres personnes, qui considèrent les centaines d’ouvrages édités qui emploient ce verbe, le terme est un néologisme. Toutefois, selon l\'Office Québécois de la langue Française, Il s’agit d\'un terme acceptable.', 'Surtout utilisé dans un contexte professionnel.', 1, '2012-08-02 14:44:55', '2019-04-05 14:59:30'),
