(1265, 'faire-passer-un-sapin-se', 'Faire passer un sapin (se)', '', '', 'Deux origines possibles :\n\n1. Vient de la pratique malhonnête consistant à vendre du sapin comme bois de chauffage. \n\n2. Historiquement, les Québécois étaient les bûcherons et les Canadiens anglais étaient les chefs d\'entreprises, donc plus riches. Lorsque les Anglais venaient chercher le bois d\'épinette (un bois de qualité) pour la construction de leur maison, les Québécois mettaient du bois de sapin (mauvais bois) au travers de la livraison. Les Québécois « passaient un sapin » aux Anglais.', '', '', 1, '2013-12-15 08:56:33', '2019-04-05 14:59:30'),
