(1569, 'chier-sul-baku', 'chier su\'l baku', 'Ba-ku', '', 'Pris du travail des bûcherons qui avaient à travailler avec des chevaux qui, pour démontrer leur résistance ou leur refus, déféquaient sur le \'back-up\', c\'est-à-dire, une pièce de bois située directement derrière le cheval pour l\'empêcher de reculer sur la voiture qu\'il tirait.', '', '', 1, '2015-12-26 17:48:42', '2019-04-05 14:59:30'),
