(1573, 'tu-dedoublement', 'Tu (dédoublement)', '', '', '', 'Le \"tu\" est parfois combiné au \"y\" (il) pour parler de la troisième personne du singulier. Exemple: \"Y veux-tu manger de la pizza?\" (Veut-il manger de la pizza?)\n\nVoir \"Tu (précédé de)\"', '', 1, '2016-03-31 17:53:24', '2019-04-05 14:59:30'),
