(1578, 'pate-chinois-corriger', 'pâté chinois (corriger)', '', '', 'On en relève les premières attestations dans les années 1930 au Québec.', 'L\'explication de son lien avec les travailleurs chinois de la construction du « train de la Confédération canadienne » ne tient pas. Le train fut construit dans les années 1860-1880 et les attestations de « pâté chinois » selon le Dictionnaire historique du français québécois (Trésor de la langue française au Québec) ne commencent qu\'en 1930.  ', '', 1, '2016-04-11 13:33:04', '2019-04-05 14:59:30'),
