(1622, 'ye-bin-quetaine', 'Yé bin quétaine', 'ké-tè-ne', 'Quétaine = cucu, kitch, désuet, gênant', 'Quétaine provient du nom d\'une famille anglaise Keaton. Cette famille anglaise de la ville de Saint Hyacinthe était des fermiers qui s\'habillaient pauvrement, ainsi on vous disait être Keaton prononcé en français donne Quétaine.', 'On l\'utilise souvent pour rire de quelque chose de vieillot, de très passé de mode, de très cliché, mais c\'est généralement gênant. Par exemple, musicalement parlant, quand une chanson des BSB ou des Spice girls, passe à la radio, on peut facilement s\'exclamer que cette chanson est kitch, mais monter le volume au nom de la nostalgie !', '', 1, '2017-07-27 00:05:43', '2019-04-05 14:59:30'),
